import React, { Component } from 'react';
import '../component-styles/project.css'
import Slider from "react-slick";
class ProjectsCard extends Component {
  render() {
    const settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 3,
      slidesToScroll:3
    };
    return (
      <div id='project-main-card-container'> 
      <Slider {...settings}>
      <div className='project-card-container'>1 </div> <div className='project-card-container'>
          <h3 style={{textAlign:'center',border:"1px solid black"}}>2</h3>
        </div> <div className='project-card-container'>
          <h3 style={{textAlign:'center',border:"1px solid black"}}>3</h3>
        </div> <div className='project-card-container'>
          <h3 style={{textAlign:'center',border:"1px solid black"}}>4</h3>
        </div> <div className='project-card-container'>
          <h3 style={{textAlign:'center',border:"1px solid black"}}>5</h3>
        </div> <div className='project-card-container'>
          <h3 style={{textAlign:'center',border:"1px solid black"}}>6</h3>
        </div> <div className='project-card-container'>
          <h3 style={{textAlign:'center',border:"1px solid black"}}>7</h3>
        </div> <div className='project-card-container'>
          <h3 style={{textAlign:'center',border:"1px solid black"}}>8</h3>
        </div> <div className='project-card-container'>
          <h3 style={{textAlign:'center',border:"1px solid black"}}>9</h3>
        </div>
      </Slider>
    </div>
    );
  }
}

export default  ProjectsCard ;
